--

CREATE FUNCTION fn_get_district(public.geometry) RETURNS integer
    LANGUAGE plpgsql
    AS $_$
	DECLARE
		geom ALIAS FOR $1;
		fk_district integer;
	BEGIN
		SELECT district.id INTO fk_district
			FROM  qwat_od.district
			WHERE ST_Intersects(geom,district.geometry) IS TRUE
			LIMIT 1;
		RETURN fk_district;
	END;
$_$;


