--

CREATE FUNCTION fn_litres_per_cm(fk_type integer, dim1 double precision, dim2 double precision) RETURNS double precision
    LANGUAGE plpgsql
    AS $$
	BEGIN
		IF fk_type = 1 THEN
			return pi()*(dim1/2)^2*10;
		ELSEIF fk_type = 2 THEN
			return dim2*dim2*10;
		ELSE
			return NULL;
		END IF;
	END
$$;


