-- Name: settings; Type: TABLE; Schema: qwat_sys; Owner: -
--

CREATE TABLE settings (
    id integer NOT NULL,
    name character varying(30),
    type regtype,
    value text,
    v_min double precision,
    v_max double precision,
    v_not_null boolean DEFAULT true,
    description text,
    CONSTRAINT check_value CHECK ((
CASE
    WHEN ((type)::oid = ANY (ARRAY[('integer'::regtype)::oid, ('double precision'::regtype)::oid])) THEN
    CASE
        WHEN ((v_max IS NOT NULL) AND (v_min IS NOT NULL)) THEN (((value)::double precision <= v_max) AND ((value)::double precision >= v_min))
        WHEN (v_max IS NOT NULL) THEN ((value)::double precision <= v_max)
        WHEN (v_min IS NOT NULL) THEN ((value)::double precision >= v_min)
        ELSE true
    END
    ELSE true
END AND
CASE
    WHEN v_not_null THEN (value IS NOT NULL)
    ELSE true
END)),
    CONSTRAINT setting_type CHECK (((type)::oid = ANY (ARRAY[('boolean'::regtype)::oid, ('integer'::regtype)::oid, ('double precision'::regtype)::oid, ('text'::regtype)::oid])))
);


